INSERT INTO `wp_comments` (`comment_ID`, `comment_post_ID`, `comment_author`, `comment_author_email`, `comment_author_url`, `comment_author_IP`, `comment_date`, `comment_date_gmt`, `comment_content`, `comment_karma`, `comment_approved`, `comment_agent`, `comment_type`, `comment_parent`, `user_id`) VALUES
(10001, 10001, 'A WordPress Commenter', 'wapuu@wordpress.example', 'https://wordpress.org/', '', '2018-05-29 05:00:08', '2018-05-29 05:00:08', 'Hi, this is a comment.\nTo get started with moderating, editing, and deleting comments, please visit the Comments screen in the dashboard.\nCommenter avatars come from <a href=\"https://gravatar.com\">Gravatar</a>.', 0, '1', '', '', 0, 1000),
(10002, 10037, 'Mary Smith', 'marketer1@disicple.tools', '', '', '2018-05-29 13:35:45', '2018-05-29 13:35:45', 'Zeyn filled out the webform and clicked \"I want to know more about Jesus\".', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1005),
(10003, 10036, 'David Smith', 'marketer2@disciple.tools', '', '', '2018-05-29 13:38:02', '2018-05-29 13:38:02', 'This is my neighbor from Morocco, living in Madrid currently. I am adding him to Disciple.Tools because I gave him a Bible last week and He has been reading it. We read Matthew 5-7 together, and he was excited to read more on his own.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
(10004, 10038, 'Mary Smith', 'marketer1@disicple.tools', '', '', '2018-05-29 13:39:12', '2018-05-29 13:39:12', 'This contact selected \"I want to become a Christian, but there are obstacles\" on the webform.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1005),
(10005, 10039, 'Mary Smith', 'marketer1@disicple.tools', '', '', '2018-05-29 13:41:04', '2018-05-29 13:41:04', 'This contact selected \"I feel in my heart that I\'m ready to become a Christian\" on the webform.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1005),
(10006, 10040, 'Mary Smith', 'marketer1@disicple.tools', '', '', '2018-05-29 13:42:37', '2018-05-29 13:42:37', 'This contact selected \"I want to know more about Jesus and the Bible\" on the webform.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1005),
(10007, 10041, 'David Smith', 'marketer2@disciple.tools', '', '', '2018-05-29 13:44:13', '2018-05-29 13:44:13', 'He private messaged us on FB. He came with the usual questions/arguments, \"God can\'t have a son,\" \"what is the trinity?\" \"the Bible has been corrupted.\" However, he has been responding with great follow up questions to the articles I sent him on these topics. He is very open to expanding his knowledge base. He is asking to get a Bible of his own and wants to meet a Christian in person. ', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
(10008, 10042, 'Mary Smith', 'marketer1@disicple.tools', '', '', '2018-05-29 13:44:45', '2018-05-29 13:44:45', 'This contact selected \"I want to know more about Jesus and the Bible\" on the webform.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1005),
(10009, 10043, 'Mary Smith', 'marketer1@disicple.tools', '', '', '2018-05-29 13:46:49', '2018-05-29 13:46:49', 'This contact selected \"No, I\'m not interested right now\" on the webform.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1005),
(10010, 10045, 'Mary Smith', 'marketer1@disicple.tools', '', '', '2018-05-29 13:52:55', '2018-05-29 13:52:55', 'Saira has been following our page for a while, though she has not made any comments, only likes. She finally messaged me today and asked me to send her a Bible.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1005),
(10011, 10046, 'David Smith', 'marketer2@disciple.tools', '', '', '2018-05-29 13:55:47', '2018-05-29 13:55:47', 'Yamina contacted our Facebook page after having a dream about Jesus. In the dream, the person she believe was Jesus told her to read \"Ya, Yamina, read my Words. Don\'t be afraid.\" Then after he disappeared, there was a table before her filled with loaves and loaves of bread, and she heard His voice say, \"Eat and you will live.\" She has been going to the university in Madrid and has had some positive interactions with people who go to church. She isn\'t sure what the difference is between Catholicism and Protestantism but she is anxious to meet with someone who can give her Jesus\' Words in her language. ', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
(10012, 10047, 'Mary Smith', 'marketer1@disicple.tools', '', '', '2018-05-29 13:55:51', '2018-05-29 13:55:51', 'Tarik has commented several times on our page, asking questions. He seems to desire to know more, though does not know much about the Bible yet. He sent a private message asking to talk with someone to learn more.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1005),
(10013, 10048, 'David Smith', 'marketer2@disciple.tools', '', '', '2018-05-29 14:03:24', '2018-05-29 14:03:24', 'Ahmen has been very active on the Facebook page, defending against negative posts. He messaged us asking if he could meet with someone to learn how to become a Christian. He likes that the page is in Arabic and he can still meet with someone while living abroad.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
(10014, 10049, 'Mary Smith', 'marketer1@disicple.tools', '', '', '2018-05-29 14:07:45', '2018-05-29 14:07:45', 'This contact lives in Gibraltar, but used to live in Madrid. She speaks Spanish fluently. She has been messaging back and forth with me for a few weeks, and seems very interested in talking. She seems very intelligent, and desired to learn more, but is reluctant to bring shame to her elderly parents. She is working on her masters in psychology.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1005),
(10015, 10050, 'David Smith', 'marketer2@disciple.tools', '', '', '2018-05-29 14:11:00', '2018-05-29 14:11:00', 'His parents moved to Spain seeking asylum 20 years ago. He recently found our page and states that he is a Christian. His parents are MBB background which is why they had to leave their country in Syria. He states that he would like to get involved helping other refugees and Arab speakers learn about Jesus. ', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
(10016, 10051, 'Mary Smith', 'marketer1@disicple.tools', '', '', '2018-05-29 14:11:11', '2018-05-29 14:11:11', 'He\'s atheist and a philosophy student and wants to read the Bible.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1005),
(10017, 10052, 'David Smith', 'marketer2@disciple.tools', '', '', '2018-05-29 14:12:56', '2018-05-29 14:12:56', 'He wants to meet with someone face to face. He is asking a lot of good questions and seems like a ready contact for face to face', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
(10018, 10053, 'David Smith', 'marketer2@disciple.tools', '', '', '2018-05-29 14:14:46', '2018-05-29 14:14:46', 'She wants to read the Bible with someone face to face.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
(10019, 10054, 'David Smith', 'marketer2@disciple.tools', '', '', '2018-05-29 14:17:05', '2018-05-29 14:17:05', 'Met a Christian in his country and after working in Spain, wanting to meet more Christians. Seems like he has read quite a bit of the Bible before. ', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
(10020, 10055, 'David Smith', 'marketer2@disciple.tools', '', '', '2018-05-29 14:19:36', '2018-05-29 14:19:36', 'Ready to meet with someone face to face', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
(10021, 10056, 'David Smith', 'marketer2@disciple.tools', '', '', '2018-05-29 14:20:28', '2018-05-29 14:20:28', 'Ready to meet with someone face-to-face', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
(10022, 10037, 'Damián Abellán (Dispatcher)', 'dispatcher1@disciple.tools', '', '', '2018-05-29 14:39:10', '2018-05-29 14:39:10', '@[Christopher Berganza (multiplier)](11) This guy filled out our webform, wanting to know more about Jesus, and gave his phone number. Would you be able to call him and see where he\'s at and if he would like to meet up?', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1006),
(10023, 10038, 'Damián Abellán (Dispatcher)', 'dispatcher1@disciple.tools', '', '', '2018-05-29 14:42:53', '2018-05-29 14:42:53', '@[Christopher Berganza (multiplier)](11)  new guy in Castilla. Can you try to meet with him when you travel there next?', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1006),
(10024, 10039, 'Damián Abellán (Dispatcher)', 'dispatcher1@disciple.tools', '', '', '2018-05-29 14:44:24', '2018-05-29 14:44:24', '@[Christopher Berganza (multiplier)](11) This guy is down in Morocco, but has said he wants to become a Christian. Can you call him and see if he would be willing to meet you halfway?', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1006),
(10025, 10040, 'Damián Abellán (Dispatcher)', 'dispatcher1@disciple.tools', '', '', '2018-05-29 14:45:17', '2018-05-29 14:45:17', '@[Christopher Berganza (multiplier)](11) Found a guy actually near you! Please call him and find out where he\'s at.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1006),
(10026, 10042, 'Damián Abellán (Dispatcher)', 'dispatcher1@disciple.tools', '', '', '2018-05-29 14:47:41', '2018-05-29 14:47:41', '@[Isabel Arboleda (multiplier)](9) This lady would like to find out more. Can you call her and try to meet?', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1006),
(10027, 10043, 'Damián Abellán (Dispatcher)', 'dispatcher1@disciple.tools', '', '', '2018-05-29 14:51:18', '2018-05-29 14:51:18', '@[Christopher Berganza (multiplier)](11) This contact said he\'s not interested on the webform, but took the time anyway to fill out the form and give us his phone number. It might be worth giving him a call anyway.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1006),
(10028, 10045, 'Damián Abellán (Dispatcher)', 'dispatcher1@disciple.tools', '', '', '2018-05-29 14:52:51', '2018-05-29 14:52:51', '@[Isabel Arboleda (multiplier)](9) Would you be able to meet up with Saira to give a Bible? She lives in Catalonia.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1006),
(10029, 10041, 'Rachel Black (dispatcher)', 'dispatcher2@disciple.tools', '', '', '2018-05-29 14:53:15', '2018-05-29 14:53:15', '@[Anthony Palacio (multiplier)](10) See my note on this guy below. Can you give him a call today?', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1007),
(10030, 10047, 'Damián Abellán (Dispatcher)', 'dispatcher1@disciple.tools', '', '', '2018-05-29 14:53:57', '2018-05-29 14:53:57', '@[Christopher Berganza (multiplier)](11) This guy is trying to learn more. He said he lives in Aragon, but ask him if he would meet you halfway.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1006),
(10031, 10055, 'Rachel Black (dispatcher)', 'dispatcher2@disciple.tools', '', '', '2018-05-29 14:55:04', '2018-05-29 14:55:04', '@[Anthony Palacio (multiplier)](10) This guy has been discussing some deep stuff on FB. I think he should probably go ahead and meet with someone face to face. You can check out the convo on FB if you log-in if you would like some more context. But remember, don\'t bring up what you read about him say because you don\'t want to creep him out.  See if he is willing to meet you soon.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1007),
(10032, 10049, 'Damián Abellán (Dispatcher)', 'dispatcher1@disciple.tools', '', '', '2018-05-29 14:55:06', '2018-05-29 14:55:06', '@[Isabel Arboleda (multiplier)](9) Check out the comment below. Please call Charifa and see if you can meet.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1006),
(10033, 10051, 'Damián Abellán (Dispatcher)', 'dispatcher1@disciple.tools', '', '', '2018-05-29 14:56:14', '2018-05-29 14:56:14', '@[Christopher Berganza (multiplier)](11) Would you try and meet up with Youssouf to give him a Bible?', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1006),
(10034, 10048, 'Rachel Black (dispatcher)', 'dispatcher2@disciple.tools', '', '', '2018-05-29 14:56:15', '2018-05-29 14:56:15', '@[Anthony Palacio (multiplier)](10) When are you heading to Castilla region? I have this guy and a couple others you could try to meet up with on your next round. Let me know and I will assign you all of them.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1007),
(10035, 10048, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '', '2018-05-29 15:03:36', '2018-05-29 15:03:36', '@[Rachel Black (dispatcher)](7) I am actually planning on going there next week. Send them all my way and I will contact them today.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1010),
(10036, 10048, 'Rachel Black (dispatcher)', 'dispatcher2@disciple.tools', '', '', '2018-05-29 15:04:51', '2018-05-29 15:04:51', '@[Anthony Palacio (multiplier)](10) Perfect! Thanks for the quick reply.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1007),
(10037, 10054, 'Rachel Black (dispatcher)', 'dispatcher2@disciple.tools', '', '', '2018-05-29 15:07:18', '2018-05-29 15:07:18', '@[Anthony Palacio (multiplier)](10) Here is guy #2 from Castilla. He is also Tunisian. I wonder if there is a population of them growing out there. See what you can find out, ok? Thanks!', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1007),
(10038, 10056, 'Rachel Black (dispatcher)', 'dispatcher2@disciple.tools', '', '', '2018-05-29 15:07:50', '2018-05-29 15:07:50', '@[Anthony Palacio (multiplier)](10) Here is guy #3 from Castilla. He hasn\'t mention where he is from originally.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1007),
(10039, 10045, 'Isabel Arboleda (multiplier)', 'multiplier1@disciple.tools', '', '', '2018-05-29 15:11:37', '2018-05-29 15:11:37', 'I called Saira and she seems keen to meet up. She says she\'s not sure what to believe anymore and wants to read more to decide for herself. She is 17 and in her final year at school. She is busy this week with exams so I will call her again next week.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1009),
(10040, 10054, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '', '2018-05-29 15:14:44', '2018-05-29 15:14:44', 'Phone Call Notes: \n\n- This guy is hungry!\n- Someone gave him a Bible in Tunisia\n- Starting working in Spain 2 years ago\n- Has another friend he has been talking to (invited him to join us)\n- His friend\'s name is Mazifa\n- Available to meet next week (monday-wed for coffee after work)\n- Scheduled for Tuesday at 5:30 pm. Will meet in front of the big statue on the Main St.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1010),
(10041, 10049, 'Isabel Arboleda (multiplier)', 'multiplier1@disciple.tools', '', '', '2018-05-29 15:17:00', '2018-05-29 15:17:00', '@[Damián Abellán (Dispatcher)](6) I\'m sorry, I\'m not able to travel as far as Gibraltar - it\'s a bit too far for me, without a car. Please can you assign this to someone else?', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1009),
(10042, 10048, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '', '2018-05-29 15:18:40', '2018-05-29 15:18:40', 'Phone Call notes:\n\n- He called while I was on the phone with Amesfal. \n- Called back and he answered this time\n- He was super excited about my call. He has been actually reading a ton of our articles on our website. \n- Asked him if he had any friends that he could bring with him and he said he didn\'t know of any interested like him\n- Encouraged him to think of others open minded like him and feel free to have them join us\n- Scheduled to meet for Tuesday lunch at 12:30 pm.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1010),
(10043, 10049, 'Damián Abellán (Dispatcher)', 'dispatcher1@disciple.tools', '', '', '2018-05-29 15:20:32', '2018-05-29 15:20:32', '@[Jane Doe (multiplier)](4) Would you be able to travel to Gibraltar, or get Charifa to meet you halfway?', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1006),
(10044, 10041, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '', '2018-05-29 15:22:46', '2018-05-29 15:22:46', '@[David Smith](8) Hey bud, I gave this guy a call but it was the wrong number. Can you message him again on FB and double check with him on the number? Thanks!', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1010),
(10045, 10045, 'Damián Abellán (Dispatcher)', 'dispatcher1@disciple.tools', '', '', '2018-05-29 15:25:18', '2018-05-29 15:25:18', '@[Isabel Arboleda (multiplier)](9) Since she is 17, it might be a good idea to ask if her parents are fine with her bringing a Bible home. You can always show her how to get it on her phone (in fact, it\'s good to do this anyway), if she can\'t have one at home. We try to be careful with minors.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1006),
(10046, 10050, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '', '2018-05-29 15:27:52', '2018-05-29 15:27:52', 'Phone Call Notes:\n\n- This guy is passionate! Man, I like this guy.\n- He told me a similar story as David mentioned, told him to tell me more when we meet\n- He really wants to meet. He said he is available tomorrow morning.\n- Meeting at 9 am at the main roundabout with the big flag', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1010),
(10047, 10056, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '', '2018-05-29 15:33:17', '2018-05-29 15:33:17', 'Phone Call Notes:\n\n- This guy feels sketchy to me. Maybe he is scared because he is dodging my questions a bit. \n- I told him my friend David gave me his number but he was still unsure and didn\'t really want to meet\n\n@[David Smith](8)  Can you make sure this guy is actually ready or reassure him?', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1010),
