(10057, 10040, 'Christopher Berganza (multiplier)', 'multiplier4@disciple.tools', '', '', '2018-05-30 14:12:01', '2018-05-30 14:12:01', 'We talked on the phone for a while. He has a lot of questions. He did ask if I could give him a Bible. We will try to meet tomorrow evening.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1011),
