(10059, 10047, 'Christopher Berganza (multiplier)', 'multiplier4@disciple.tools', '', '', '2018-05-30 14:16:00', '2018-05-30 14:16:00', 'I have talked with Tarik on the phone twice already, in 3 days! He has a lot of questions, but also just seems to need a friend. He isn\'t able to travel this week, but has to come to Madrid in a week for business.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1011),
(10060, 10051, 'Christopher Berganza (multiplier)', 'multiplier4@disciple.tools', '', '', '2018-05-30 14:18:13', '2018-05-30 14:18:13', 'I will try to call him tonight and see where he lives in Castilla y Leon, if he\'s close to Madrid, I should be able to meet with him this week.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1011),
(10061, 10050, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '', '2018-06-01 12:02:39', '2018-06-01 12:02:39', 'This guy is the real deal! He shared more details about his story with me. He comes from a seemingly grounded Biblical family. He has been baptized and has a strong relationship with the Lord. He says he is very interested in getting involved in sharing his faith and seemed very teachable.\n\nI would like to help coach him on being able to share his story/testimony in different fragments of time. I would also like that we put together a list of 100 people he knows in his life and start casting vision about sharing His story and God\'s story with those people. \n\nHe wants to meet again this week.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1010),
(10062, 10048, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '', '2018-06-01 12:14:58', '2018-06-01 12:14:58', 'What a great first meeting! He didn\'t bring anyone with him. I shared the creation to Christ story with him to set up the basis that the Bible is a full story, made complete in Christ. We read Matthew 1-7 together in our meeting. He kept speaking a lot about how different it was than Islam.\n\nI encouraged him to read the entire book of Matthew nothing stories and words Jesus uses about what it means to follow Him. I told him to give me a call when he is finished reading it and ready to meet again.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1010),
(10063, 10056, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '', '2018-06-01 12:16:35', '2018-06-01 12:16:35', 'I called Mohammed the day before, the day of, during when were supposed to meet and he didn\'t answer.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1010),
(10064, 10054, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '', '2018-06-01 12:24:46', '2018-06-01 12:24:46', 'Amesfal brought Mazifa. He met him in Spain and began sharing with him what he had been learning about God from the Injil. We started reading Matthew. Amesfal was very talkative so it was sometimes difficult to gauge where Mazifa was in it all. We read Matthew 5 like a DBS (Discovery Bible Study). This helped Mazifa have a chance to talk more. Had to really push the DNA of asking them, \"Where do you see that in the passage?\" By the end, they were automatically doing that. I encouraged them to read the Book of Matthew. I casted vision of other Tunisians like them discovering, sharing, and obeying God\'s Word together. It excited them.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1010),
