(10082, 10049, 'Jane Doe (multiplier)', 'multiplier2@disciple.tools', '', '', '2018-06-01 14:39:25', '2018-06-01 14:39:25', 'Sharif brought her roommate Aisha. We started reading in Matthew together. They read in Arabic and explained the passage to me. I asked them DBS style questions as we went. Toward the end, they were both very convinced that this was the true way. They said they want to learn how to becomes Christians. I encouraged them to keep reading Matthew and take note of what it means to follow Jesus and we could all meet again and talk about it. They were excited to both receive a Bible. Aisha even kissed her\'s!', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1004),
(10083, 10067, 'Jane Doe (multiplier)', 'multiplier2@disciple.tools', '', '', '2018-06-01 14:41:53', '2018-06-01 14:41:53', 'Planning to meet this Thursday for coffee at 7 pm.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1004),
(10084, 10053, 'Jane Doe (multiplier)', 'multiplier2@disciple.tools', '', '', '2018-06-01 14:44:02', '2018-06-01 14:44:02', 'Scheduled a meeting for tomorrow at 1 pm', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1004),
(10085, 10066, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '', '2018-06-01 14:49:38', '2018-06-01 14:49:38', 'Note: He was already baptized\n Met with Nassim. Very interesting guy and I want to continue meeting with him. He came to faith four years ago and has been alone for most of his walk with the Lord. He actually got baptized by someone in Morocco. He hasn\'t had any regular fellowship though since that group stopped meeting. I talk to him about the vision of starting a group of other Moroccans in Extremadura. He got really excited and we read through Acts one and two. I used it to cast a vision that a church could be started anywhere and he really caught on to the idea. Then we walked through Matthew 1-4 and I modeled for him how he could do this without others. I told him to make a list of 100 and he already had some ideas of who he could share with. He was super grateful that I had came out and met with him and very excited that he had someone to talk to. He has two sisters, both are married, one of them is married to a Spanish Christian and the other one is married to another Muslim guy from Morocco. Apparently his parents are very open-minded.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1010),
(10086, 10065, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '', '2018-06-01 14:51:09', '2018-06-01 14:51:09', '@[David Smith](8) Can you ask him for his real number? This one doesn\'t work.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1010),
(10087, 10064, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '', '2018-06-01 14:52:15', '2018-06-01 14:52:15', 'He is in the middle of studying, has read two books of the NT in spanish. Wants to meet up but is busy with studies. Told him to start reading Matthew and we would discuss it when we met.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1010),
(10088, 10066, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '', '2018-06-01 14:56:48', '2018-06-01 14:56:48', 'May 15- met with Nassim again. It was a good meeting. We read through Matthew 5-10. We talked about bringing in a friend and having him walk them through Matthew 1- 10. At the end of our meeting he talked about us needing to get together for a longer period of time so that he could invite someone and we can walk them through Matthew. Hopefully we will do that soon. I actually had him walk me through Matthew five through 10 next and teach it to me and just gave him suggestions on how better to explain. I think it helped gave him confidence that he can do this on his own.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1010),
