(10094, 10064, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '', '2018-06-01 15:03:03', '2018-06-01 15:03:03', 'After the weekend, he is going to find us a good place to meet and a time that works.\n He has actually read all four gospels and Acts. He is currently reading Romans. He says he can\'t meet until Spring Break because that\'s the first break he gets from class but I told him I could see him', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1010),
(10095, 10064, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '', '2018-06-01 15:04:01', '2018-06-01 15:04:01', 'He could only meet on Saturday and I was already booked solid. Will try next Saturday', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1010),
(10096, 10064, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '', '2018-06-01 15:09:27', '2018-06-01 15:09:27', 'May 17- Met with the new guy Nabil today. We met downtown. He is 15 years old. He is studying and about four years ago saw a documentary on how Arabs invaded North African and tried forcing many of the Berbers to change. He decided he wouldn\'t go back to Islam. He\'s been to the mosque to pray but he just felt like it was wrong. he wanted to see some signs. Started reading the Bible. One day he was sitting in a park and he felt a burning sensation in the palms of his hand, where they crucified Jesus. And then he saw two doves fly by in the direction of downtown. He took it as a sign that he needed to go downtown and when he went downtown he found a bookseller and the bookseller just happen to have a copy of the Bible in Arabic.  Up until then He had mostly been reading it online and from Facebook. He has read Matthew through Romans and is currently in first Corinthian\'s. We read from Matthew 1-6 as well as Matthew 28. He got the vision and he wants to be baptized. He actually considers himself a believer since last November. He was praying and asking God for help and then I called him. His dad is a dentist here and an atheist. He lived in Portugal for a while. His mother is Muslim but she\'s not very strong in the faith. They already know that he\'s a Christian. They don\'t have a problem with it.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1010),
(10097, 10064, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '', '2018-06-01 15:11:19', '2018-06-01 15:11:19', 'He continues to study and read through the Bible. He has finished all the Gospels and the Epistles up to 1 Peter. Good questions so far and growing in his understanding. He is also in the middle of exams and can\'t really meet but at least he has continued to study the Word.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1010),
(10098, 10069, 'Mary Smith (marketer)', 'marketer1@disicple.tools', '', '', '2018-06-01 15:29:59', '2018-06-01 15:29:59', 'This man became attracted  to Christianity through TV, he has never read a Gospel nor met a believer, but he would like to do both. He lives in Madrid.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1005),
(10099, 10069, 'Damián Abellán (Dispatcher)', 'dispatcher1@disciple.tools', '', '', '2018-06-01 15:40:46', '2018-06-01 15:40:46', '@[Christopher Berganza (multiplier)](11) Here is another from Madrid.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1006),
(10100, 10069, 'Christopher Berganza (multiplier)', 'multiplier4@disciple.tools', '', '', '2018-06-01 15:43:25', '2018-06-01 15:43:25', 'He has watched brother Rashed on TV but has never read a Bible and doesn\'t have a smartphone. Meeting arranged for Saturday at 12pm in town. Will call Saturday to confirm and decide on location.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1011),
(10101, 10069, 'Christopher Berganza (multiplier)', 'multiplier4@disciple.tools', '', '', '2018-06-01 15:46:00', '2018-06-01 15:46:00', 'Meeting went well. He wanted to read the Bible. Gave him NT. Shared the Gospel with him and gave him the intro to Matthew. Reading comprehension was pretty good.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1011),
(10102, 10069, 'Christopher Berganza (multiplier)', 'multiplier4@disciple.tools', '', '', '2018-06-01 15:52:36', '2018-06-01 15:52:36', 'Met with Wasim again today. He is further along. Finished reading Matthew. Understood a lot of the big ideas but is still thinking from an Islamic mindset. Hopefully more time in the word will change that. Will have him read the book of John next and then acts. We looked at several passages today.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1011),
(10103, 10069, 'Christopher Berganza (multiplier)', 'multiplier4@disciple.tools', '', '', '2018-06-01 15:56:34', '2018-06-01 15:56:34', 'I called a few times to see how he was doing - no answer, then he called back and missed me.\nI called again and he didn\'t have work today so we set a time to meet. Wasim had already finished reading John since last week. I felt led to read through Matthew 5, so he read a section and then we talked about each section all the way through Matthew 5. He expressed two times that he has entered into being a follower now.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1011),
(10104, 10069, 'Christopher Berganza (multiplier)', 'multiplier4@disciple.tools', '', '', '2018-06-01 15:59:08', '2018-06-01 15:59:08', 'Met with Wisam. It was a great meeting. He has read up to revelation. More exciting is that he has had a dream last night. He saw Jesus appear to him. Jesus told him \"if you love me you will love Allah. I will love you\" I showed him John 14 \"I am the way the truth and the life...\" He said \"that\'s what Jesus was telling me!!!\" I have been reading, now what do I have to do, I want to do more than read I want to follow Jesus. I showed him acts 2. Repent and be baptized. He wanted to get baptized tomorrow already! Praise God.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1011),
(10105, 10069, 'Christopher Berganza (multiplier)', 'multiplier4@disciple.tools', '', '', '2018-06-01 16:03:09', '2018-06-01 16:03:09', 'Praise God!', 0, 'trash', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1011);
INSERT INTO `wp_comments` (`comment_ID`, `comment_post_ID`, `comment_author`, `comment_author_email`, `comment_author_url`, `comment_author_IP`, `comment_date`, `comment_date_gmt`, `comment_content`, `comment_karma`, `comment_approved`, `comment_agent`, `comment_type`, `comment_parent`, `user_id`) VALUES
(10106, 10069, 'Damián Abellán (Dispatcher)', 'dispatcher1@disciple.tools', '', '', '2018-06-01 16:05:29', '2018-06-01 16:05:29', 'Praise God!', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1006),
(10107, 10069, 'Christopher Berganza (multiplier)', 'multiplier4@disciple.tools', '', '', '2018-06-01 16:18:03', '2018-06-01 16:18:03', 'Met up with Wisam. We traveled over to the coast to baptize him. On the way out he was talking about how he wanted to be an ambassador for Christ and get the word out to everyone. I asked him to retell how he came to know Christ. He talked about searching. Comparing the Koran and Injil. Then he had a dream. Jesus appeared to him. In a white robe and a bright light. His face was covered in light. He said \"you are my son (child) follow me.\" He said he felt peace and mercy and joy like he never had before. Then he woke up. There was no turning back after that.\n When he was baptized he said he felt like a new man, something powerful happened. We studied acts 1-3 together. He is really catching the vision.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1011),
(10108, 10069, 'Christopher Berganza (multiplier)', 'multiplier4@disciple.tools', '', '', '2018-06-01 16:23:23', '2018-06-01 16:23:23', 'It has been a week since Wasim got baptized and he had a second dream last night. Jesus appeared to him and told him to not be afraid. I am sending you to tell others about me, to many other nations.\nPTL! He is re-reading Acts now.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1011),
(10109, 10067, 'Jane Doe (multiplier)', 'multiplier2@disciple.tools', '', '', '2018-06-05 15:48:09', '2018-06-05 15:48:09', 'We had a great meeting. Read through Matthew 1-5. I could tell she was getting tired toward the end of 5, so I encouraged her to keep reading on her own and contact me when she is finished reading Matthew. \n\nBefore she started to show signs of being tired, she was very engaged in the Word and had lots of good questions. I told her to write down her questions and wait and see if the Bible answers them for her. Just like a good story, we have to wait and see what happens.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1004),
(10110, 10046, 'Jane Doe (multiplier)', 'multiplier2@disciple.tools', '', '', '2018-06-05 15:49:38', '2018-06-05 15:49:38', 'Excited to meet. Was studying all week but is done with her finals for this semester. Plan to meet this Thursday night at 7 pm.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1004),
(10111, 10049, 'Jane Doe (multiplier)', 'multiplier2@disciple.tools', '', '', '2018-06-05 15:53:40', '2018-06-05 15:53:40', 'Met with Sharif and Aisha again. They both read through Matthew and were excited to meet again. They really dug into the Book and had lots of great insights as they explained back what they had learned and discovered. They both expressed that they believe that Jesus is more than a prophet and want to keep reading the Bible and learn more. I asked them to explain to me what they think it means to follow Jesus and be a Christian. We started reading in the Book of John together. They are going to read that Book and call me when they are finished with it.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1004),
(10112, 10071, 'Jane Doe (multiplier)', 'multiplier2@disciple.tools', '', '', '2018-06-05 15:55:06', '2018-06-05 15:55:06', 'Friend of Charif.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1004),
(10113, 10071, 'Jane Doe (multiplier)', 'multiplier2@disciple.tools', '', '', '2018-06-05 15:55:43', '2018-06-05 15:55:43', 'Met with Sharif and Aisha again. They both read through Matthew and were excited to meet again. They really dug into the Book and had lots of great insights as they explained back what they had learned and discovered. They both expressed that they believe that Jesus is more than a prophet and want to keep reading the Bible and learn more. I asked them to explain to me what they think it means to follow Jesus and be a Christian. We started reading in the Book of John together. They are going to read that Book and call me when they are finished with it.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1004),
(10114, 10070, 'Jane Doe (multiplier)', 'multiplier2@disciple.tools', '', '', '2018-06-05 15:56:31', '2018-06-05 15:56:31', 'Met with Sharif and Aisha again. They both read through Matthew and were excited to meet again. They really dug into the Book and had lots of great insights as they explained back what they had learned and discovered. They both expressed that they believe that Jesus is more than a prophet and want to keep reading the Bible and learn more. I asked them to explain to me what they think it means to follow Jesus and be a Christian. We started reading in the Book of John together. They are going to read that Book and call me when they are finished with it.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1004),
(10115, 10053, 'Jane Doe (multiplier)', 'multiplier2@disciple.tools', '', '', '2018-06-05 15:59:04', '2018-06-05 15:59:04', 'I tried calling her the morning of and an hour before but she didn\'t answer. I decided to show up this time but she didn\'t show. I will try to call her again and see what happened and try to reschedule.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1004),
(10116, 10072, 'David Smith', 'marketer2@disciple.tools', '', '', '2018-06-05 16:07:16', '2018-06-05 16:07:16', 'Wants a Book mailed. ', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
(10117, 10073, 'David Smith', 'marketer2@disciple.tools', '', '', '2018-06-05 16:08:17', '2018-06-05 16:08:17', 'A young, high school girl wants to receive a Book and meet a Christian. ', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
(10118, 10074, 'David Smith', 'marketer2@disciple.tools', '', '', '2018-06-05 16:09:56', '2018-06-05 16:09:56', 'A wife wants to learn how to become a Christian. She said her husband has been watching satellite Christian programs, and they are both wanting to receive a Bible. ', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
(10119, 10075, 'David Smith', 'marketer2@disciple.tools', '', '', '2018-06-05 16:11:02', '2018-06-05 16:11:02', 'Wants to receive a Bible', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
(10120, 10076, 'David Smith', 'marketer2@disciple.tools', '', '', '2018-06-05 16:14:25', '2018-06-05 16:14:25', 'Read Matthew online 1-10. Says she wants to receive an actual Book.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
(10121, 10077, 'David Smith', 'marketer2@disciple.tools', '', '', '2018-06-05 16:16:26', '2018-06-05 16:16:26', 'A woman living in Morocco contacted our FB page and says she doesn\'t know any Christians but wants to meet one. ', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
(10122, 10078, 'David Smith', 'marketer2@disciple.tools', '', '', '2018-06-05 16:17:41', '2018-06-05 16:17:41', 'Been talking on our FB chat for a long time. I think she is ready to meet offline.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
(10123, 10065, 'David Smith', 'marketer2@disciple.tools', '', '', '2018-06-06 11:43:06', '2018-06-06 11:43:06', '@[Anthony Palacio (multiplier)](10) Here is his real number', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
(10124, 10079, 'David Smith', 'marketer2@disciple.tools', '', '', '2018-06-06 11:44:38', '2018-06-06 11:44:38', 'He wants to receive a Book', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
(10125, 10080, 'David Smith', 'marketer2@disciple.tools', '', '', '2018-06-06 11:46:26', '2018-06-06 11:46:26', 'He wants to read the Bible with a Christian and learn more about the Christian religion', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
(10126, 10081, 'David Smith', 'marketer2@disciple.tools', '', '', '2018-06-06 11:47:03', '2018-06-06 11:47:03', 'He wants a Book mailed to him only', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
(10127, 10068, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '', '2018-06-06 11:53:26', '2018-06-06 11:53:26', 'He is interested in studying. Lives near by and don\'t have a Book. Wants to meet tomorrow.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1010),
(10128, 10068, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '', '2018-06-06 11:54:19', '2018-06-06 11:54:19', 'met and gave him a Book. His family was in the car and so we werent able to meet for long. He works downtown though and we hope to meet during the week.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1010),
(10129, 10068, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '', '2018-06-06 11:54:43', '2018-06-06 11:54:43', 'He called me back and wants to meet up. Would like to meet saturday.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1010),
(10130, 10068, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '', '2018-06-06 12:00:32', '2018-06-06 12:00:32', 'May 19- met with Sabri. He is a really nice guy. Paid for the coffee. Wants to learn more because he is worried about the extremists and what they are teaching his kids in the schools. He is an IT guy. His wife also works. They have 2 kids. Both teenagers. He is very open and so is his wife he wants to study this with his kids. We walked through Matthew 1-3 and he liked it and really thought it was easy to understand. I shared the gospel with him and he received it well. We talked about meeting downtown for lunch.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1010),
(10131, 10068, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '', '2018-06-06 12:01:43', '2018-06-06 12:01:43', 'He has been busy with a work conference but hopes to meet for lunch tomorrow or this weekend.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1010),
(10132, 10068, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '', '2018-06-06 12:02:17', '2018-06-06 12:02:17', 'He has been busy with work but would like to meet up on  Tuesday or Thursday for lunch.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1010),
(10133, 10068, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '', '2018-06-06 12:02:57', '2018-06-06 12:02:57', 'I am back from a trip. He doesn\'t work on Sunday. May meet up Sunday.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1010),
(10134, 10068, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '', '2018-06-06 12:05:07', '2018-06-06 12:05:07', 'His phone is off now. I haven\'t been able to get a hold of him for months now.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1010),
(10135, 10065, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '', '2018-06-06 14:06:18', '2018-06-06 14:06:18', 'He is 16 years old. More curious than anything else. His mom actually brought him, kind of awkward. She spent the first 20 min explaining that he was a good boy. She didn\'t want him getting into trouble but didn\'t care if he read the Book. Just didn\'t want him smoking. Her husband left them and that made life difficult. The kid doesn\'t have a lot of friends but meets people online on facebook. She then left and said she would be across the street and we could talk. The boy is more curious. Doesn\'t know much but wants to read.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1010),
(10136, 10065, 'David Smith', 'marketer2@disciple.tools', '', '', '2018-06-06 14:30:06', '2018-06-06 14:30:06', '@[Anthony Palacio (multiplier)](10) He wrote to me and asked if we can give him another copy of the Book because he has a group of friends interested in reading it', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
(10137, 10064, 'David Smith', 'marketer2@disciple.tools', '', '', '2018-06-06 14:31:49', '2018-06-06 14:31:49', '@[Anthony Palacio (multiplier)](10) He asked online about baptism. He said that he wants to be baptised but he is afraid because of sin.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008);
